using HtmlAgilityPack;
using Microsoft.AspNetCore.Http.Extensions;
using Stock.Common.Helpers;
using Stock.Model.BO;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace Stock.Service.Scrubbing
{
    public static class SeasonReportScrubbing
    {
        public static async Task<List<SeasonReportBO>> WorkFromDate(DateTime date)
        {

            date = new DateTime(date.Year, date.Month, 1);

            var siiUrl = $"https://www.cnyes.com/twstock/financial4.aspx";
            List<SeasonReportBO> list = new List<SeasonReportBO>();
            var sii = await GetHtml(siiUrl, "T", $"{date.Year}Q{(date.Month - 1) / 3 + 1}");
            var otc = await GetHtml(siiUrl, "O", $"{date.Year}Q{(date.Month - 1) / 3 + 1}");

            list.AddRange(Analytics(sii, date));
            list.AddRange(Analytics(otc, date));
            return list;
        }

        public static async Task<string> GetHtml(string url, string marketType, string date)
        {

            string html = "";
            var viewState = "";
            Dictionary<string, string> dic = new Dictionary<string, string>();
            dic.Add("ctl00$ContentPlaceHolder1$D1", marketType);
            dic.Add("ctl00$ContentPlaceHolder1$D2", "ALL");
            dic.Add("ctl00$ContentPlaceHolder1$D3", date);
            dic.Add("__VIEWSTATE", viewState);
            var request = new HttpRequestMessage(HttpMethod.Get, url);
            var form = new FormUrlEncodedContent(dic);
            using (HttpClient httpClient = new HttpClient())
            {
                var res = await httpClient.PostAsync(url, form);
                html = await res.Content.ReadAsStringAsync();

            }
            return html;
        }

        public static List<SeasonReportBO> Analytics(string html, DateTime date)
        {
            var doc = new HtmlDocument();
            doc.LoadHtml(html);
            var node = doc.DocumentNode;
            var searchTime = $"{date.Year}Q{(date.Month - 1) / 3 + 1}";
            var time = node.SelectSingleNode("//*[contains(@id,'ctl00_ContentPlaceHolder1_UpdatePanel1')]/cite").InnerHtml;
            var result=new List<SeasonReportBO>();
            if (!time.Contains(searchTime))
            {
                return new List<SeasonReportBO>();
            }

            result = node.SelectNodes("//*[contains(@id, 'ctl00_ContentPlaceHolder1_GridView1')]/tr").Select(r =>
            {
                SeasonReportBO reportBO = null;
                try
                {
                    long longTemp = 0;
                    decimal decimalTemp = 0;

                    List<HtmlNode> table = r.SelectNodes("td").ToList();
                    reportBO = new SeasonReportBO
                    {
                        StockCode = table[0].InnerText,
                        StockName = table[1].InnerText.Replace(" ", ""),
                        OperatingIncome = long.TryParse(table[2].InnerHtml.Replace(",", ""), out longTemp) ? longTemp : 0,
                        OperatingProfitLoss = long.TryParse(table[3].InnerHtml.Replace(",", ""), out longTemp) ? longTemp : 0,
                        OutSideIncome = long.TryParse(table[4].InnerHtml.Replace(",", ""), out longTemp) ? longTemp : 0,
                        TaxBegoreProfitLoss = long.TryParse(table[5].InnerHtml.Replace(",", ""), out longTemp) ? longTemp : 0,
                        TaxAfterProfitLoss = long.TryParse(table[6].InnerHtml.Replace(",", ""), out longTemp) ? longTemp : 0,
                        EPS = decimal.TryParse(table[7].InnerHtml.Replace(",", ""), out decimalTemp) ? decimalTemp : 0,
                        Season = date.Month / 3,
                        DataTime = date,
                        CreateTime = DateTime.Now,
                    };
                }
                catch { }
                return reportBO;
            }).Where(w => w != null).ToList();
            return result;
        }
    }
}
